const InputTodo = () => {
    return (
    <Fragment>
        <h1 className="text-center mt-5">Input Todo</h1>
        <form className="d-flex">
            <input type="text" className="form-control" />
            <button className="btn btn-success">Add</button>
        </form>
    </Fragment> 
    );
};

export default InputTodo;
